import React, { useState, useEffect } from 'react';
import { BrowserRouter, Route, Link } from 'react-router-dom';
import './App.css';
import M from 'materialize-css/dist/js/materialize.min.js';
import ProductDisplayScreen from './screens/ProductDisplayScreen';
import ProductScreen from './screens/ProductScreen';
import CartScreen from './screens/CartScreen';
import SigninScreen from './screens/SigninScreen';
import { useSelector } from 'react-redux';
import RegisterScreen from './screens/RegisterScreen';
import ProductsScreen from './screens/ProductsScreen';
import ShippingScreen from './screens/ShippingScreen';
import PaymentScreen from './screens/PaymentScreen';
import PlaceOrderScreen from './screens/PlaceOrderScreen';
import OrderScreen from './screens/OrderScreen';
import ProfileScreen from './screens/ProfileScreen';
import OrdersScreen from './screens/OrdersScreen';
import TermsOfUse from './screens/TermsOfUse';
import PrivacyPolicy from './screens/PrivacyPolicy';
import TermsOfSupply from './screens/TermsOfSupply';


function App() {
  const [searchKeyword, setSearchKeyword] = useState('');
  const userSignin = useSelector((state) => state.userSignin);
  const { userInfo } = userSignin;

  useEffect(() => {
    // Init Materialize JS
    M.AutoInit();
  });

  return (
    <BrowserRouter>
      <div className="grid-container">

        <header>
          
          <div className="logos">
            <a href="/" data-target="slide-out" className="sidenav-trigger bolder"><i className="fas fa-bars" aria-hidden="true"></i></a><br/>
          </div>

          <div className="logos">
            <Link to="/">AZ-TECH</Link>
          </div>

          <div className="navbar">
            <ul>
              <li><i className="fas fa-home"></i></li>
              <li><Link to="/cart/:id"><i className="fas fa-shopping-cart"></i></Link></li>
            {userInfo && userInfo.isAdmin && (
              <>
